public object FfiConverterTypeGraphDB: FfiConverter<GraphDb, Long> {
    override fun lower(value: GraphDb): Long {
        return value.uniffiCloneHandle()
    }

    override fun lift(value: Long): GraphDb {
        return GraphDb(UniffiWithHandle, value)
    }

    override fun read(buf: ByteBuffer): GraphDb {
        return lift(buf.getLong())
    }

    override fun allocationSize(value: GraphDb) = 8UL

    override fun write(value: GraphDb, buf: ByteBuffer) {
        buf.putLong(lower(value))
    }
}



